--
-- SP_COMPUTE_RL_PERCENTAGE  (Procedure) 
--
CREATE OR REPLACE PROCEDURE JBDEMOGAME.SP_COMPUTE_RL_PERCENTAGE AS
total NUMBER := 0;
el_index NUMBER := 0;
resultPercentCursor sys_refcursor;
l_sql varchar2(2000);
l_serverid number;
l_zero number;
l_red number;
l_black number;
l_even number;
l_odd number;
l_from_1_to_18 number;
l_from_19_to_36 number;
l_time timestamp;
l_dealertype number;
BEGIN
  l_sql :=
  '  select
  a.serverid,
  sum(case when a.winnumber=0 then 1 else 0 end)/count(*) ZERO,
  sum(case when b.color=''R'' then 1 else 0 end)/count(*) RED,
  sum(case when b.color=''B'' then 1 else 0 end)/count(*) BLACK,
  sum(case when MOD(a.winnumber, 2)=0 and a.winnumber !=0 then 1 else 0 end)/count(*) EVEN,
  sum(case when MOD(a.winnumber, 2)=1 then 1 else 0 end)/count(*) ODD,
  sum(case when a.winnumber>0 and a.winnumber<19 then 1 else 0 end)/count(*) FROM_1_TO_18,
  sum(case when a.winnumber>18 and a.winnumber<37 then 1 else 0 end)/count(*) FROM_19_TO_36,
  current_timestamp TIME,
  c.dealertype DEALERTYPE
  from rlgameresultserver a, rlcolormapping b, dealertable c
  where a.winnumber = b.num and a.serverid = c.serverid
  group by a.serverid, c.dealertype';

  OPEN resultPercentCursor for l_sql;
    LOOP
       FETCH resultPercentCursor INTO l_serverid, l_zero, l_red, l_black, l_even, l_odd, l_from_1_to_18, l_from_19_to_36, l_time, l_dealertype;
       EXIT WHEN resultPercentCursor%NOTFOUND;
       select count(*) INTO total from rlgameresultpercentage where serverid = l_serverid;
       IF total = 0 THEN
           INSERT INTO rlgameresultpercentage
           (ZERO, RED, BLACK, EVEN, ODD, FROM_1_TO_18, FROM_19_TO_36, TIME, SERVERID, DEALERTYPE)
           VALUES (l_zero, l_red, l_black, l_even, l_odd, l_from_1_to_18, l_from_19_to_36, l_time, l_serverid, l_dealertype);
       ELSE
           UPDATE rlgameresultpercentage
           SET zero=l_zero, red=l_red, black=l_black, even=l_even, odd=l_odd, from_1_to_18=l_from_1_to_18, from_19_to_36=l_from_19_to_36, time=l_time, dealertype=l_dealertype
           WHERE serverid=l_serverid;
       END IF;
    END LOOP;

  CLOSE resultPercentCursor;
END SP_COMPUTE_RL_PERCENTAGE;
/


--
-- SP_GAMEHISTORY_RANK_JACKPOT  (Procedure) 
--
CREATE OR REPLACE PROCEDURE JBDEMOGAME."SP_GAMEHISTORY_RANK_JACKPOT" AS
  l_partnerweb_sql varchar2(1000);
  l_refcursor sys_refcursor;
  l_partner_id number;
  l_web_id number;
BEGIN
  l_partnerweb_sql := 'select 1 as partnerId, (case when webId is null then 0 else webId end) as webId from kl01.accounts where webid > 0 and webid is not null group by webId';
  OPEN l_refcursor for l_partnerweb_sql;
  LOOP
       FETCH l_refcursor INTO l_partner_id, l_web_id;
       EXIT WHEN l_refcursor%NOTFOUND;
       DBMS_OUTPUT.put_line('process partnerId : ' || to_char(l_partner_id) || ', webId : ' || to_char(l_web_id));
       DELETE FROM GameHistoryRankByJackpot WHERE PartnerID = l_partner_id and WebId = l_web_id;
       INSERT INTO GameHistoryRankByJackpot
        SELECT
          RankNo,
          GameSeqNo,
          SessionNo,
          PlayerId,
          PartnerID,
          WebId,
          MNum,
          TTLWinJackpot,
          LastModifyTime,
          MType,
          UID_0,
          UID_1,
          UID_2,
          UID_3,
          UID_4,
          UID_5,
          UID_6,
          UID_7,
          UID_8,
          UID_9
        FROM
        (
          SELECT
            ROW_NUMBER() OVER(ORDER BY TTLWinJackpot DESC) as RankNo,
            GameSeqNo,
            SessionNo,
            PlayerId,
            PartnerID,
            WebId,
            MNum,
            TTLWinJackpot,
            LastModifyTime,
            MType,
            UID_0,
            UID_1,
            UID_2,
            UID_3,
            UID_4,
            UID_5,
            UID_6,
            UID_7,
            UID_8,
            UID_9
          FROM
            GameHistory
          WHERE
            PartnerID = l_partner_id and
            WebId = l_web_id and
            TTLWinJackpot > 0 and MType in (SELECT machineType FROM machinetype where gametypeid=1) and  TTLWinGamble = 0 and
            LastModifyTime BETWEEN TO_DATE(to_char(sysdate,'yyyy/mm/dd'),'yyyy/mm/dd') AND TO_DATE(to_char(sysdate+1,'yyyy/mm/dd'),'yyyy/mm/dd')
          ORDER BY TTLWinJackpot DESC
        )
        WHERE
          (ROWNUM <= 20);
        COMMIT;
  END LOOP;
  CLOSE l_refcursor;
END SP_GAMEHISTORY_RANK_JACKPOT;
/


--
-- SP_GAMEHISTORY_RANK_RATIO  (Procedure) 
--
CREATE OR REPLACE PROCEDURE JBDEMOGAME."SP_GAMEHISTORY_RANK_RATIO" AS
  l_partnerweb_sql varchar2(1000);
  l_refcursor sys_refcursor;
  l_partner_id number;
  l_web_id number;
BEGIN
  l_partnerweb_sql := 'select 1 as partnerId, (case when webId is null then 0 else webId end) as webId from kl01.accounts where webid > 0 and webid is not null group by webId';
  OPEN l_refcursor for l_partnerweb_sql;
  LOOP
       FETCH l_refcursor INTO l_partner_id, l_web_id;
       EXIT WHEN l_refcursor%NOTFOUND;
       DBMS_OUTPUT.put_line('process partnerId : ' || to_char(l_partner_id) || ', webId : ' || to_char(l_web_id));
       DELETE FROM GameHistoryRankByRatio WHERE PartnerID = l_partner_id and WebId = l_web_id and LastModifyTime BETWEEN TO_DATE(to_char(sysdate,'yyyy/mm/dd'),'yyyy/mm/dd') AND TO_DATE(to_char(sysdate+1,'yyyy/mm/dd'),'yyyy/mm/dd');
       INSERT INTO GameHistoryRankByRatio
        SELECT
          RankNo,
          GameSeqNo,
          SessionNo,
          PlayerId,
          PartnerID,
          WebId,
        	MNum,
          TTLBet,
          Ratio,
        	LastModifyTime,
          MType,
          UID_0,
          UID_1,
          UID_2,
          UID_3,
          UID_4,
          UID_5,
          UID_6,
          UID_7,
          UID_8,
          UID_9
        FROM
        (
          SELECT
            ROW_NUMBER() OVER(ORDER BY TTLWinGame/TTLBet DESC) as RankNo,
            GameSeqNo,
            SessionNo,
            PlayerId,
            PartnerID,
            WebId,
            MNum,
            TTLBet,
            TTLWinGame/TTLBet as ratio,
            LastModifyTime,
            MType,
            UID_0,
            UID_1,
            UID_2,
            UID_3,
            UID_4,
            UID_5,
            UID_6,
            UID_7,
            UID_8,
            UID_9
          FROM
            GameHistory
          WHERE
            PartnerID = l_partner_id and
            WebId = l_web_id and
            TTLBet > 0 and
            TTLWinGame > 0 and
            TTLWinJackpot = 0 and
            MType in (SELECT machineType FROM machinetype where gametypeid=1) and
            TTLWinGamble = 0 and
            LastModifyTime BETWEEN TO_DATE(to_char(sysdate,'yyyy/mm/dd'),'yyyy/mm/dd') AND TO_DATE(to_char(sysdate+1,'yyyy/mm/dd'),'yyyy/mm/dd')
          ORDER BY TTLWinGame/TTLBet DESC
        )
        WHERE
          (ROWNUM <= 20);
        COMMIT;
  END LOOP;
  CLOSE l_refcursor;
END SP_GAMEHISTORY_RANK_RATIO;
/


