p_serverid number;
p_zero number;
p_red number;
p_black number;
p_even number;
p_odd number;
p_from_1_to_18 number;
p_from_19_to_36 number;
p_time timestamp;
p_dealertype number;
BEGIN
    OPEN dealerTableCursor for select serverid, dealertype from dealertable where machinetype=26;
    LOOP
       FETCH dealerTableCursor INTO d_serverid, d_dealertype;
       EXIT WHEN dealerTableCursor%NOTFOUND;
           OPEN countCursor for select * from rlgameresultcount where serverid = d_serverid and dealertype = d_dealertype;
           LOOP
               FETCH countCursor into l_id, l_zero, l_red, l_black, l_even, l_odd, l_from_1_to_18, l_from_19_to_36, l_total, l_time, l_serverid, l_dealertype, l_lastrecordid;
               EXIT WHEN countCursor%NOTFOUND;
           END LOOP;
           IF countCursor%ROWCOUNT = 0 THEN
               OPEN resultPercentCursor for
                  select
                  a.serverid,
                  sum(case when a.winnumber=0 then 1 else 0 end) ZERO,
                  sum(case when b.color='R' then 1 else 0 end) RED,
                  sum(case when b.color='B' then 1 else 0 end) BLACK,
                  sum(case when MOD(a.winnumber, 2)=0 and a.winnumber !=0 then 1 else 0 end) EVEN,
                  sum(case when MOD(a.winnumber, 2)=1 then 1 else 0 end) ODD,
                  sum(case when a.winnumber>0 and a.winnumber<19 then 1 else 0 end) FROM_1_TO_18,
                  sum(case when a.winnumber>18 and a.winnumber<37 then 1 else 0 end) FROM_19_TO_36,
                  count(*) TOTAL,
                  current_timestamp TIME,
                  c.dealertype DEALERTYPE,
                  max(a.id) LASTRECORDID
                  from rlgameresultserver a, rlcolormapping b, dealertable c
                  where a.winnumber = b.num and a.serverid = c.serverid and a.serverid=d_serverid
                  group by a.serverid, c.dealertype;
               LOOP
                   FETCH resultPercentCursor INTO r_serverid, r_zero, r_red, r_black, r_even, r_odd, r_from_1_to_18, r_from_19_to_36, r_total, r_time, r_dealertype, r_lastrecordid;
                   EXIT WHEN resultPercentCursor%NOTFOUND;
                   INSERT INTO rlgameresultcount (ZERO, RED, BLACK, EVEN, ODD, FROM_1_TO_18, FROM_19_TO_36, TOTAL, TIME, SERVERID, DEALERTYPE, LASTRECORDID)
                   VALUES (r_zero, r_red, r_black, r_even, r_odd, r_from_1_to_18, r_from_19_to_36, r_total, r_time, r_serverid, r_dealertype, r_lastrecordid);
               END LOOP;
               CLOSE resultPercentCursor;
           ELSE
               OPEN resultPercentCursor for
                  select
                  a.serverid,
                  sum(case when a.winnumber=0 then 1 else 0 end) ZERO,
                  sum(case when b.color='R' then 1 else 0 end) RED,
                  sum(case when b.color='B' then 1 else 0 end) BLACK,
                  sum(case when MOD(a.winnumber, 2)=0 and a.winnumber !=0 then 1 else 0 end) EVEN,
                  sum(case when MOD(a.winnumber, 2)=1 then 1 else 0 end) ODD,
                  sum(case when a.winnumber>0 and a.winnumber<19 then 1 else 0 end) FROM_1_TO_18,
                  sum(case when a.winnumber>18 and a.winnumber<37 then 1 else 0 end) FROM_19_TO_36,
                  count(*) TOTAL,
                  current_timestamp TIME,
                  c.dealertype DEALERTYPE,
                  max(a.id) LASTRECORDID
                  from rlgameresultserver a, rlcolormapping b, dealertable c
                  where a.winnumber = b.num and a.serverid = c.serverid and a.serverid=d_serverid and a.id > l_lastrecordid
                  group by a.serverid, c.dealertype;
               LOOP
                   FETCH resultPercentCursor INTO r_serverid, r_zero, r_red, r_black, r_even, r_odd, r_from_1_to_18, r_from_19_to_36, r_total, r_time, r_dealertype, r_lastrecordid;
                   EXIT WHEN resultPercentCursor%NOTFOUND;
                   UPDATE rlgameresultcount
                   SET zero=zero+r_zero, red=red+r_red, black=black+r_black, even=even+r_even, odd=odd+r_odd, from_1_to_18=from_1_to_18+r_from_1_to_18, from_19_to_36=from_19_to_36+r_from_19_to_36, total=total+r_total, time=r_time, dealertype=r_dealertype, lastrecordid=r_lastrecordid 
                   WHERE serverid=l_serverid;
               END LOOP;
               CLOSE resultPercentCursor;
           END IF;
           CLOSE countCursor;
    END LOOP;
  CLOSE dealerTableCursor;
 
  p_sql :=
  '  select
  serverid,
  zero/total ZERO,
  red/total RED,
  black/total BLACK,
  even/total EVEN,
  odd/total ODD,
  from_1_to_18/total FROM_1_TO_18,
  from_19_to_36/total FROM_19_TO_36,
  current_timestamp TIME,
  dealertype DEALERTYPE
  from rlgameresultcount';
 
  OPEN percentCursor for p_sql;
    LOOP
       FETCH percentCursor INTO p_serverid, p_zero, p_red, p_black, p_even, p_odd, p_from_1_to_18, p_from_19_to_36, p_time, p_dealertype;
       EXIT WHEN percentCursor%NOTFOUND;
       select count(*) INTO p_total from rlgameresultpercentage where serverid = p_serverid;
       IF p_total = 0 THEN
           INSERT INTO rlgameresultpercentage
           (ZERO, RED, BLACK, EVEN, ODD, FROM_1_TO_18, FROM_19_TO_36, TIME, SERVERID, DEALERTYPE)
           VALUES (p_zero, p_red, p_black, p_even, p_odd, p_from_1_to_18, p_from_19_to_36, p_time, p_serverid, p_dealertype);
       ELSE
           UPDATE rlgameresultpercentage
           SET zero=p_zero, red=p_red, black=p_black, even=p_even, odd=p_odd, from_1_to_18=p_from_1_to_18, from_19_to_36=p_from_19_to_36, time=p_time, dealertype=p_dealertype
           WHERE serverid=p_serverid;
       END IF;
    END LOOP;
  CLOSE percentCursor;
END SP_TEST_RL_PERCENTAGE;
/


--
-- SPLIT_PARTITION_BY_INTERVAL  (Function) 
--
CREATE OR REPLACE FUNCTION JBDEMOGAME.SPLIT_PARTITION_by_interval
 (v_para_owner_name        IN VARCHAR2
 ,v_para_table_name        IN VARCHAR2
 ,v_para_tablespace_name   IN VARCHAR2
 ,v_para_split_datetime    IN VARCHAR2
 ,v_para_interval          IN NUMBER
 ,v_para_days_to_drop_part IN NUMBER)
return number
is
   V_PARTITION_NAME_PREFIX          varchar2(30);
   v_partition_name_hh24            varchar2(30);
   v_partition_name                 varchar2(30);
   v_partition_high_value           varchar2(4000);
   v_nowtime                        varchar2(4000);
   v_sql                            varchar2(4000);
   v_current_datetime               date;
   v_HIGH_VALUE                     date;
   v_partition_exist                number;
   v_interval_step                  number;
   v_pmax_rowcnt                    number;
   v_total_hours                    number;
   v_remainder                      number;
   i                                number;

   e_pmax_not_existed               exception;
   e_pmax_not_empty                 exception;
begin
   dbms_output.enable(100000);

   v_current_datetime := to_date(v_para_split_datetime,'yyyymmddhh24');

   dbms_output.put_line(chr(10)); -- Line feed
   dbms_output.put_line('Split/Drop partition DateTime (yyyymmddhh24) => ' || to_char(v_current_datetime,'yyyymmddhh24'));

   /*******************************************/
   /* Check PMAX partition   in table        **/
   /*******************************************/
   --- Check if PMAX partition existed
   select count(1) into v_partition_exist from all_tab_partitions where table_name = v_para_table_name and partition_name = 'PMAX' ;

   if v_partition_exist != 1 then
      RAISE e_pmax_not_existed;
   end if;

   --- Check PMAX partition row counts
   v_sql := 'select count(1) from '|| v_para_owner_name || '.' || v_para_table_name || ' partition (PMAX)';
   execute immediate v_sql into v_pmax_rowcnt ;

   if v_pmax_rowcnt > 0 then
      RAISE e_pmax_not_empty;
   end if ;

   /*******************************************/
   /* Create new partitions in table         **/
   /*******************************************/

  dbms_output.put_line(chr(10)); -- Line feed
  dbms_output.put_line('1) Split partition command:');
  i := 0;

  for r1 in ( select * from (SELECT partition_name, high_value, tablespace_name
             from all_tab_partitions
            where table_name = upper(v_para_table_name)
             and partition_name != 'PMAX'
         order by partition_position desc) where rownum = 1)
   loop

       EXECUTE IMMEDIATE 'SELECT ' || r1.HIGH_VALUE || ' FROM dual' INTO v_HIGH_VALUE;

       if v_HIGH_VALUE  < v_current_datetime + v_para_interval/24
       then
          v_interval_step := trunc(to_number(to_char(v_current_datetime, 'hh24'))/v_para_interval) ;
          v_remainder     := mod(to_number(to_char(v_current_datetime, 'hh24')),v_para_interval) ;

          if (v_remainder = 0)
          then
             v_total_hours   := v_para_interval*(v_interval_step + 1) ;
          else
             v_total_hours   := v_para_interval*(v_interval_step + 2) ;
          end if ;

          if (v_total_hours >= 24)
          then
             v_partition_name_hh24 := trim(to_char(v_total_hours-24,'09')) ;
             v_partition_name_prefix := to_char(trunc(v_current_datetime)+1, 'yyyymmdd') ;
          else
             v_partition_name_hh24 := trim(to_char(v_total_hours,'09')) ;
             v_partition_name_prefix := to_char(trunc(v_current_datetime), 'yyyymmdd');
          end if;

          v_partition_name := 'P'||v_partition_name_prefix||v_partition_name_hh24;
          v_partition_high_value := v_partition_name_prefix||v_partition_name_hh24;

          v_sql := 'alter table ' || v_para_owner_name || '.' || v_para_table_name || ' split partition PMAX at (to_date(''' || v_partition_high_value || ''',''yyyymmddhh24'')) into (partition ' || v_partition_name || ' TABLESPACE ' || v_para_tablespace_name || ', partition PMAX TABLESPACE ' || v_para_tablespace_name || ') UPDATE INDEXES';

          dbms_output.put_line(v_sql || ' ;');
          execute immediate v_sql;

          i := i+1 ;

       end if;
   end loop;

   if ( i = 0)
   then
       dbms_output.put_line('none');
   end if;

   /*******************************************/
   /* Drop old partitions in table           **/
   /*******************************************/
   dbms_output.put_line(chr(10)); -- Line feed
   dbms_output.put_line('2) Drop partition command:');
   i := 0;

   for r1 in (SELECT PARTITION_NAME, HIGH_VALUE
             from all_tab_partitions
            where table_name = upper(v_para_table_name)
              and partition_name != 'PMAX'
         order by partition_position )
   loop
       EXECUTE IMMEDIATE 'SELECT ' || r1.HIGH_VALUE || ' FROM dual' INTO v_HIGH_VALUE;

       if v_HIGH_VALUE  < (v_current_datetime - v_para_days_to_drop_part)
       then
          v_sql := 'alter table ' || v_para_owner_name || '.' || v_para_table_name || ' drop partition ' || r1.partition_name;
          dbms_output.put_line(v_sql || ' ;');
          execute immediate v_sql;

          i := i+1 ;

       end if;
   end loop;

   if ( i = 0)
   then
       dbms_output.put_line('none');
   end if;
   dbms_output.put_line(chr(10)); -- Line feed

   /**********************************/
   /** Return 1 to Java if NO ERROR **/
   /**********************************/
   return 1;

EXCEPTION
   when e_pmax_not_existed then
        return 99998 ;

   when e_pmax_not_empty then
        return 99997 ;

   when OTHERS then
        -- DBMS_OUTPUT.PUT_LINE('Error: '||sqlcode||' '||sqlerrm);
        DBMS_OUTPUT.PUT_LINE(sqlerrm);
        return 99999 ;
end;
/


