--
CREATE OR REPLACE TRIGGER JBDEMOGAME.GAMEHISTORYTRIGGER BEFORE INSERT ON JBDEMOGAME.GAMEHISTORY FOR EACH ROW
DISABLE
BEGIN
   SELECT GAMEHISTORYSEQ.NEXTVAL
  INTO   :new.id
  FROM   dual;
END;
