--
-- FISHGAMEHISTORY_TRG  (Trigger) 
--
CREATE OR REPLACE TRIGGER JBDEMOGAME."FISHGAMEHISTORY_TRG" 
BEFORE INSERT ON JBDEMOGAME.FISHGAMEHISTORY 
FOR EACH ROW
BEGIN
  <<COLUMN_SEQUENCES>>
  BEGIN
    IF INSERTING AND :NEW.ID IS NULL THEN
      SELECT FISHGAMEHISTORY_SEQ.NEXTVAL INTO :NEW.ID FROM SYS.DUAL;
    END IF;
  END COLUMN_SEQUENCES;
END;
/


